System.register("chunks:///_virtual/GameRules.ts",["./rollupPluginModLoBabelHelpers.js","cc","./DependencyContainer.ts","./GameRulesButtonPressed.ts","./MenuButtonClicked.ts"],(function(e){var n,a,t,i,o,s,r,l,u,d,c,h;return{setters:[function(e){n=e.applyDecoratedDescriptor,a=e.inheritsLoose,t=e.initializerDefineProperty,i=e.assertThisInitialized},function(e){o=e.cclegacy,s=e._decorator,r=e.Label,l=e.director,u=e.Component},function(e){d=e.DependencyContainer},function(e){c=e.GameRulesButtonPressed},function(e){h=e.MenuButtonClicked}],execute:function(){var m,p,g,w,k;o._RF.push({},"c0562UOAVxALLZreUSp0Cte","GameRules",void 0);var x=s.ccclass,b=s.property;e("GameRules",(m=x("GameRules"),p=b(r),m((k=n((w=function(e){function n(){for(var n,a=arguments.length,o=new Array(a),s=0;s<a;s++)o[s]=arguments[s];return n=e.call.apply(e,[this].concat(o))||this,t(n,"rulesText",k,i(n)),n.eventSystem=void 0,n.rulesMap={en:"GAME RULES\n\nGame Overview:\nDrop the Boss is a physics-driven gambling game. The aim of the game is to keep the Boss's momentum from reaching 0. With each bet, Boss accumulates prizes based on distance, stunts, collected items, and the final landing zone. The game includes random multipliers, bonus triggers, and high-reward feature endings.\n\nHow to Play:\nDuring Boss’s descent, various actions contribute to your total win:\nCollect Mega Hats: +0.2x multiplier per hat\nHit Coin: +2.0x multiplier\nComplete a Front Flip or Backflip: +0.1x multiplier per flip\nTravel Distance: +1x multiplier per in-game metre travelled\n\nHit Storm Clouds: Divides your current accumulated win by 2 (rounded down)\n\nEngine Disaster / Eagle: It is possible for Boss to be sucked into the plane engine, or for a giant eagle to swoop down and take him away. These are losses and result in no payout.\n\nK-Hole Feature (triggered by Black Hole):\nIf Boss falls into a black hole during the game, the K-Hole Feature is triggered.\nRocket Man is launched toward “Mars”. A random multiplier between 1x and 11x is awarded. This prize multiplies your current total accumulated winnings.\n\nFeature Landing Zones:\nAt the bottom landing zone, there are several obstacles Boss is aiming for. If Boss collides with one of these obstacles, a bonus award is activated. They are as follows:\nTruck Award: Multiplies total win by 5x\nSecond Best Friend Award: Squares your payout multiplier (your bet stays the same, e.g. $2 × 5x → $2 × 25x = $50)\nChump Towers Award: Multiplies total win by 50x\nGolden Tee Award: Multiplies total win by 100x\nWhite House Award: Adds a flat 5000x to your win (not multiplied). To win the White House Award, you must land inside the building. The secret entrance is under the flag.\n\nReturn to Player:\nThis game has a theoretical RTP of 96 %.\n\nNote: Calculations done in the physics/maths engine use floating-point numbers. These numbers are rounded to two decimal places when displayed to the player. Therefore, when numbers are multiplied there may be minor rounding differences, which increase with larger figures. This is not an error; the RTP is calculated from the floating-point numbers.\n\nNote: This game uses a physics engine, and such engines may behave chaotically on occasion. Unpredictable behaviour may result in Boss stopping unexpectedly, or collisions not being detected, resulting in completion of a bet. If you experience unusual physics behaviour, please note this does not affect the RTP; prizes will be paid according to the result.\n\nResponsible Gambling Disclaimer:\nDrop the Boss is a gambling game of chance. Please play responsibly. Winnings are not guaranteed and players should wager only amounts they can afford to lose.\n\nConnectivity Protocol:\nIn the event of a disconnection, all wagers in motion at the time will be settled. Upon reconnection these wagers will not be displayed, but all winnings will have been paid out.\n\nGame version v1.0.0 – last updated 25 May 2025.",ar:'قواعد اللعبة\n\nنظرة عامة على اللعبة:\nDrop the Boss هي لعبة قمار تعتمد على الفيزياء. الهدف هو منع زخم الزعيم من الوصول إلى الصفر. في كل رهان، يجمع دون جوائز بناءً على المسافة، والحركات البهلوانية، والعناصر المجمَّعة، ومنطقة الهبوط النهائية. تتضمن اللعبة مضاعفات عشوائية، ومحفزات مكافآت، ونهايات ذات جوائز عالية.\n\nكيفية اللعب:\nأثناء سقوط دون، تُسهم الإجراءات التالية في إجمالي ربحك:\nجمع قبعات Mega: +0.2x لكل قبعة\nضرب العملة: +2.0x\nإكمال شقلبة أمامية أو خلفية: +0.1x لكل شقلبة\nالمسافة المقطوعة: +1x لكل متر داخل اللعبة\n\nضرب سحب العواصف: يقسم ربحك الحالي إلى النصف (تقريب لأسفل)\n\nكارثة المحرك/النسر: قد يُشفَط دون إلى محرك الطائرة أو يخطفه نسر عملاق؛ هذه خسارة بلا أي عائد.\n\nميزة K-Hole (تُفَعَّل بالثقب الأسود):\nإذا سقط دون في ثقب أسود أثناء اللعب، تتفعّل ميزة K-Hole.\nيُطلَق "الرجل الصاروخ" نحو "المريخ" ويُمنح مضاعف عشوائي بين 1x و 11x، ليُضاعِف ربحك المتراكم.\n\nمناطق الهبوط المميزة:\nTruck Award: يضاعف الربح الإجمالي 5x\nSecond Best Friend Award: تربيع مُضاعِف دفعتك (رهانك يظل كما هو، مثل $2 × 5x → $2 × 25x = $50)\nChump Towers Award: يضاعف الربح الإجمالي 50x\nGolden Tee Award: يضاعف الربح الإجمالي 100x\nWhite House Award: يضيف 5000x ثابتة إلى ربحك (غير مضاعَفة). للفوز بجائزة البيت الأبيض يجب أن تهبط داخل المبنى. المدخل السري تحت العلم.\n\nالعودة إلى اللاعب:\nالقيمة النظرية RTP هي 96 %.\n\nملاحظة: تتم الحسابات بأعداد عشرية عائمة وتُقرَّب إلى رقمين عشريين عند العرض؛ قد تحدث فروق تقريبية، خصوصًا مع الأرقام الكبيرة. هذا ليس خطأ؛ تم حساب RTP بهذه الأعداد.\n\nملاحظة: قد يتصرف محرك الفيزياء بشكل فوضوي؛ أي سلوك غير متوقَّع لا يؤثر على RTP وسيتم دفع الجوائز وفقًا للنتيجة.\n\nإخلاء مسؤولية اللعب المسؤول:\nDrop the Boss لعبة حظ؛ يُرجى اللعب بمسؤولية.\n\nبروتوكول الاتصال:\nفي حال انقطاع الاتصال، تُسوَّى كل الرهانات الجارية وسيتم دفع الأرباح عند إعادة الاتصال.\n\nإصدار اللعبة v1.0.0 – آخر تحديث 25 مايو 2025.',de:"SPIELREGELN\n\nSpielübersicht:\nDrop the Boss ist ein physikbasiertes Glücksspiel. Ziel des Spiels ist es, das Momentum des Bosses davon abzuhalten, 0 zu erreichen. Mit jeder Wette sammelt der Boss Gewinne basierend auf Distanz, Stunts, eingesammelten Objekten und der finalen Landezone. Zufällige Multiplikatoren, Bonus-Trigger und hochdotierte Feature-Enden sind möglich.\n\nSpielanleitung:\nWährend der Boss fällt, erhöhen folgende Aktionen deinen Gewinn:\nMega-Hüte sammeln: +0,2x pro Hut\nMünze treffen: +2,0x\nVorwärts- oder Rückwärtssalto: +0,1x pro Salto\nZurückgelegte Strecke: +1x pro Meter\n\nGewitterwolken treffen: halbiert den aktuellen Gewinn (abrunden)\n\nTriebwerkskatastrophe / Adler: Der Boss kann ins Triebwerk gesogen oder von einem Adler ergriffen werden – Verlust ohne Auszahlung.\n\nK-Hole-Feature (schwarzes Loch):\nFällt der Boss in ein schwarzes Loch, startet das K-Hole-Feature.\n„Rocket Man“ wird Richtung „Mars“ geschossen; ein zufälliger Multiplikator zwischen 1x und 11x multipliziert den bisherigen Gewinn.\n\nSpezielle Landezonen:\nTruck Award: Gewinn × 5\nSecond Best Friend Award: Quadriert deinen Auszahlungsmultiplikator (Einsatz bleibt gleich, z. B. $2 × 5x → $2 × 25x = $50)\nChump Towers Award: Gewinn × 50\nGolden Tee Award: Gewinn × 100\nWhite House Award: Addiert feste 5000x zu deinem Gewinn (nicht multipliziert). Um den White House Award zu gewinnen, musst du im Gebäude landen. Der geheime Eingang befindet sich unter der Flagge.\n\nRTP: theoretisch 96 %.\n\nHinweis: Rundungsdifferenzen durch Fließkommazahlen sind normal.\nHinweis: Unvorhersehbares Physik-Verhalten beeinflusst den RTP nicht.\n\nVerantwortungsvolles Spielen: Bitte nur mit Geld spielen, das du dir leisten kannst zu verlieren.\n\nVerbindungsprotokoll: Unterbrochene Wetten werden abgeschlossen, Gewinne ausgezahlt.\n\nSpielversion v1.0.0 – zuletzt aktualisiert am 25.05.2025.",es:"REGLAS DEL JUEGO\n\nDescripción general:\nDrop the Boss es un juego de azar basado en física. El objetivo es evitar que el impulso del jefe llegue a 0. Con cada apuesta, Boss acumula premios según distancia, acrobacias, objetos recogidos y zona de aterrizaje. Incluye multiplicadores aleatorios, disparadores de bonos y finales de alta recompensa.\n\nCómo jugar:\nDurante la caída del Boss suman a tu premio:\nSombreros Mega: +0.2x c/u\nMoneda: +2.0x\nVoltereta adelante/atrás: +0.1x c/u\nDistancia recorrida: +1x por metro\n\nNubes de tormenta: divide el premio acumulado entre 2.\n\nDesastre de motor / águila: pérdida sin pago.\n\nFunción K-Hole (agujero negro):\nSi Boss cae en un agujero negro, se lanza hacia «Marte» con un multiplicador aleatorio entre 1x y 11x que multiplica el premio actual.\n\nZonas de aterrizaje:\nTruck Award: × 5\nSecond Best Friend Award: Cuadra tu multiplicador de pago (tu apuesta permanece igual, ej.: $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Añade 5000x fijos a tu premio (no multiplicado). Para conseguir el White House Award debes aterrizar dentro del edificio. La entrada secreta está debajo de la bandera.\n\nRTP teórico: 96 %.\n\nNota: las diferencias de redondeo son normales.\nNota: los fallos físicos no afectan el RTP.\n\nJuego responsable: apuesta solo lo que puedas perder.\n\nProtocolo de conexión: las apuestas en curso se pagan al reconectar.\n\nVersión v1.0.0 – última actualización 25 may 2025.",fi:"PELIN SÄÄNNÖT\n\nYleiskuvaus:\nDrop the Boss on fysiikkaan perustuva rahapeli. Tavoitteena on estää pomon vauhtia putoamasta nollaan. Jokainen veto kartuttaa palkintoja etäisyyden, temppujen, kerättyjen esineiden ja laskeutumisalueen mukaan. Satunnaiset kertoimet ja bonukset ovat mahdollisia.\n\nPelaaminen:\nBossin pudotessa:\nMega-lippis: +0,2x/kpl\nKolikko: +2,0x\nEtu- tai takavoltti: +0,1x/voltti\nMatka: +1x/metri\n\nUkkospilvi: jakaa voiton kahdella.\n\nMoottorivika / kotka: tappio ilman voittoa.\n\nK-Hole-ominaisuus (mustan aukon laukaisema):\nJos Boss putoaa mustaan aukkoon, käynnistyy K-Hole.\nRocket Man ammutaan kohti “Marsia” ja satunnainen 1x–11x-kerroin moninkertaistaa nykyisen voittosi.\n\nLisäalueet:\nTruck Award: × 5\nSecond Best Friend Award: Korottaa voittokertoimesi toiseen potenssiin (panos pysyy samana, esim. $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Lisää tasaisesti 5000x voittoosi (ei kerrottu). Voittaaksesi White House -palkinnon sinun täytyy laskeutua rakennuksen sisään. Salainen sisäänkäynti on lipun alla.\n\nTeoreettinen RTP: 96 %.\n\nHuom: pyöristys-eroja voi esiintyä.\nHuom: odottamaton fysiikka ei muuta RTP:tä.\n\nVastuullinen pelaaminen: pelaa vain rahalla, jonka voit hävitä.\n\nYhteyskatko: keskeneräiset vedot maksetaan yhdistettäessä.\n\nVersio v1.0.0 – päivitetty 25.5.2025.",fr:"RÈGLES DU JEU\n\nVue d'ensemble:\nDrop the Boss est un jeu d'argent basé sur la physique. Le but est d'empêcher l'élan du Boss d'atteindre 0. Chaque mise accumule des gains selon la distance, les figures, les objets collectés et la zone d'atterrissage. Multiplicateurs et bonus aléatoires inclus.\n\nComment jouer:\nPendant la descente :\nChapeaux Mega : +0,2x/chapeau\nPièce : +2,0x\nSalto avant/arrière : +0,1x/salto\nDistance : +1x/mètre\n\nNuages d'orage : gain ÷ 2.\n\nCatastrophe moteur / aigle : perte sans paiement.\n\nK-Hole (trou noir) :\nSi le Boss tombe dans un trou noir, Rocket Man est lancé vers « Mars » et un multiplicateur aléatoire de 1x à 11x est appliqué au gain total.\n\nZones de bonus :\nTruck Award : × 5\nSecond Best Friend Award : Met au carré votre multiplicateur de paiement (mise inchangée, ex. : 2 $ × 5x → 2 $ × 25x = 50 $)\nChump Towers Award : × 50\nGolden Tee Award : × 100\nWhite House Award : Ajoute un bonus fixe de 5000x à votre gain (non multiplié). Pour remporter le White House Award, vous devez atterrir à l'intérieur du bâtiment. L'entrée secrète se trouve sous le drapeau.\n\nRTP théorique : 96 %.\n\nArrondis possibles ; comportement physique imprévisible n'affecte pas le RTP.\n\nJeu responsable : ne pariez que ce que vous pouvez perdre.\n\nEn cas de déconnexion, les mises en cours sont réglées ; gains déjà versés.\n\nVersion v1.0.0 – mise à jour le 25 mai 2025.",hi:"खेल नियम\n\nखेल का अवलोकन:\nDrop the Boss एक भौतिक-आधारित जुआ खेल है। लक्ष्य बॉस की गति को शून्य होने से रोकना है। प्रत्येक दांव पर दूरी, करतब, एकत्र आइटम और लैंडिंग ज़ोन के आधार पर पुरस्कार मिलते हैं। यादृच्छिक गुणक और बोनस शामिल हैं।\n\nकैसे खेलें:\nबॉस के गिरते समय:\nMega टोपी: +0.2x प्रति टोपी\nसिक्का हिट: +2.0x\nफ्लिप (आगे/पीछे): +0.1x प्रति फ्लिप\nदूरी: +1x प्रति मीटर\n\nतूफ़ानी बादल: जीत ÷ 2\n\nइंजन आपदा / गरुड़: हार, कोई भुगतान नहीं।\n\nK-Hole (ब्लैक होल) :\nयदि बॉस ब्लैक होल में गिरता है, तो Rocket Man “मंगल” की ओर प्रक्षेपित होता है और यादृच्छिक 1x–11x गुणक कुल जीत पर लागू होता है।\n\nविशेष क्षेत्र:\nTruck पुरस्कार: कुल जीत × 5\nSecond Best Friend पुरस्कार: आपके भुगतान गुणक को स्क्वायर करता है (दांव समान रहता है, उदाहरण: $2 × 5x → $2 × 25x = $50)\nChump Towers पुरस्कार: कुल जीत × 50\nGolden Tee पुरस्कार: कुल जीत × 100\nWhite House पुरस्कार: आपकी जीत में स्थिर 5000x जोड़ता है (गुणा नहीं)। White House पुरस्कार जीतने के लिए आपको इमारत के अंदर उतरना होगा। गुप्त प्रवेश द्वार झंडे के नीचे है।\n\nRTP (सैद्धांतिक): 96 %.\n\nगोलाई भिन्नताएँ सामान्य हैं; असामान्य भौतिकी RTP नहीं बदलती।\n\nज़िम्मेदार जुआ: केवल उतनी राशि दांव लगाएँ जिसे आप खो सकते हैं।\n\nडिस्कनेक्ट होने पर वर्तमान दांव निपटाए जाते हैं, जीत का भुगतान हो चुका होगा।\n\nसंस्करण v1.0.0 – अंतिम अपडेट 25 मई 2025.",id:'PERATURAN PERMAINAN\n\nGambaran Umum:\nDrop the Boss adalah game judi berbasis fisika. Tujuan permainan ini adalah menjaga momentum Bos agar tidak mencapai 0. Setiap taruhan mengumpulkan hadiah berdasarkan jarak, aksi, item, dan zona pendaratan. Terdapat pengali acak dan bonus.\n\nCara Bermain:\nSaat Bos jatuh:\nTopi Mega: +0,2x/topi\nKoin: +2,0x\nSalto: +0,1x/salto\nJarak: +1x/meter\n\nAwan badai: kemenangan ÷ 2.\n\nMesin / elang: kalah tanpa pembayaran.\n\nFitur K-Hole (lubang hitam):\nJika Bos jatuh ke lubang hitam, Rocket Man diluncurkan ke "Mars" dan pengali acak 1x–11x akan menggandakan total menang Anda.\n\nZona bonus:\nTruck Award: × 5\nSecond Best Friend Award: Mengkuadratkan pengali pembayaran Anda (taruhan tetap sama, contoh: $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Menambahkan 5000x tetap pada kemenangan Anda (tidak dikalikan). Untuk memenangkan White House Award Anda harus mendarat di dalam gedung. Pintu rahasia ada di bawah bendera.\n\nRTP teoretis: 96 %.\n\nPerbedaan pembulatan wajar; fisika tak terduga tidak memengaruhi RTP.\n\nMainlah secara bertanggung jawab.\n\nPutus koneksi: taruhan selesai, kemenangan dibayar.\n\nVersi v1.0.0 – pembaruan 25 Mei 2025.',ja:"ゲームルール\n\n概要:\nDrop the Boss は物理演算を用いたギャンブルゲームです。目標はボスのモメンタムを 0 にしないことです。距離・スタント・収集アイテム・着地点に応じて賞金が加算されます。ランダム倍率やボーナス機能を搭載。\n\n遊び方:\nボス落下中:\nMega 帽子: +0.2x/個\nコイン: +2.0x\n前後宙返り: +0.1x/回\n移動距離: +1x/m\n\n嵐雲: 賞金 ÷ 2\n\nエンジン事故 / ワシ: 敗北。\n\nK-Hole（ブラックホール）:\nボスがブラックホールに落ちると Rocket Man が「火星」へ発射され、ランダム 1x–11x が総賞金に乗算されます。\n\n着地ボーナス:\nTruck Award: × 5\nSecond Best Friend Award: 支払い倍率を二乗します（ベット額は変更されません。例: $2 × 5x → $2 × 25x = $50）\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: 勝利金に固定の 5000x を追加します（乗算なし）。White House Award を獲得するには建物内部に着地する必要があります。秘密の入口は旗の下にあります。\n\n理論 RTP: 96 %。\n\n丸め誤差あり。予測不能な物理挙動は RTP に影響しません。\n\n責任あるプレイを。\n\n切断時: ベット決済済み、賞金支払い済。\n\nv1.0.0 – 2025-05-25 更新。",ko:"게임 규칙\n\n개요:\nDrop the Boss는 물리 엔진 기반 도박 게임입니다. 목표는 보스의 모멘텀이 0이 되지 않도록 유지하는 것입니다. 거리·묘기·아이템·착지 지점에 따라 보상이 누적됩니다. 무작위 배수와 보너스가 존재합니다.\n\n플레이 방법:\nBoss 하강 중:\nMega 모자: +0.2x/개\n코인: +2.0x\n공중제비: +0.1x/회\n이동 거리: +1x/m\n\n폭풍 구름: 상금 ÷ 2\n\n엔진 사고 / 독수리: 패배, 보상 없음.\n\nK-Hole (블랙홀):\nBoss가 블랙홀에 빠지면 Rocket Man이 “Mars”로 발사되고 무작위 1x–11x가 총 상금에 곱해집니다.\n\n보너스 구역:\nTruck Award: 5x\nSecond Best Friend Award: 지급 배수를 제곱합니다 (베팅 금액은 변하지 않음, 예: $2 × 5x → $2 × 25x = $50)\nChump Towers Award: 50x\nGolden Tee Award: 100x\nWhite House Award: 승리에 고정 5000x를 추가합니다(배수 적용 없음). White House Award를 획득하려면 건물 안에 착지해야 합니다. 비밀 입구는 깃발 아래에 있습니다.\n\n이론 RTP: 96 %.\n\n반올림 오차 가능. 비정상 물리 현상은 RTP를 변경하지 않습니다.\n\n책임감 있게 플레이하세요.\n\n연결 끊김 시 베팅은 정산되며 상금은 지급됩니다.\n\n버전 v1.0.0 – 2025-05-25.",pl:"ZASADY GRY\n\nOpis:\nDrop the Boss to gra hazardowa z fizyką. Celem jest niedopuszczenie, by impet Bossa spadł do zera. Odległość, akrobacje, przedmioty i strefa lądowania zwiększają wygraną. Dostępne są losowe mnożniki i bonusy.\n\nJak grać:\nPodczas spadania:\nCzapki Mega: +0,2x/szt.\nMoneta: +2,0x\nSalto: +0,1x/szt.\nDystans: +1x/m\n\nChmury burzowe: wygrana ÷ 2\n\nSilnik / orzeł: przegrana.\n\nK-Hole (czarna dziura):\nJeśli Boss wpadnie w czarną dziurę, Rocket Man zostaje wystrzelony na „Mars”, a losowy mnożnik 1x–11x mnoży dotychczasową wygraną.\n\nStrefy bonusowe:\nTruck Award: × 5\nSecond Best Friend Award: Podnosi Twój mnożnik wypłaty do kwadratu (stawka bez zmian, np. 2 $ × 5x → 2 $ × 25x = 50 $)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Dodaje stałe 5000x do wygranej (nie mnożone). Aby zdobyć White House Award, musisz wylądować wewnątrz budynku. Tajne wejście znajduje się pod flagą.\n\nRTP teoretyczny: 96 %.\n\nRóżnice zaokrągleń są normalne; nieprzewidywalna fizyka nie wpływa na RTP.\n\nGraj odpowiedzialnie.\n\nRozłączenie: zakłady rozliczone, wygrane wypłacone.\n\nWersja v1.0.0 – 25.05.2025.",pt:"REGRAS DO JOGO\n\nVisão geral:\nDrop the Boss é um jogo de azar com física. O objetivo é impedir que o ímpeto do Chefe chegue a 0. Distância, manobras, itens e zona de pouso aumentam o prêmio. Há multiplicadores e bônus aleatórios.\n\nComo jogar:\nQueda do Boss:\nBoné Mega: +0,2x/unid.\nMoeda: +2,0x\nMortal: +0,1x/unid.\nDistância: +1x/m\n\nNuvens de tempestade: prêmio ÷ 2\n\nMotor / água: perda.\n\nK-Hole (buraco negro):\nSe o Boss cair em um buraco negro, Rocket Man é lançado rumo a “Marte” com multiplicador aleatório 1x–11x que multiplica o prêmio.\n\nZonas bônus:\nTruck Award: × 5\nSecond Best Friend Award: Eleva ao quadrado o seu multiplicador de pagamento (aposta inalterada, ex.: $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Adiciona 5000x fixos ao seu prêmio (não multiplicado). Para ganhar o White House Award você deve pousar dentro do prédio. A entrada secreta fica embaixo da bandeira.\n\nRTP teórico: 96 %.\n\nDiferenças de arredondamento podem ocorrer; física não afeta RTP.\n\nJogue com responsabilidade.\n\nDesconexão: apostas resolvidas, prêmios pagos.\n\nVersão v1.0.0 – 25/05/2025.",ru:"ПРАВИЛА ИГРЫ\n\nОбзор:\nDrop the Boss — азартная игра с физикой. Цель — не допустить, чтобы импульс босса достиг нуля. Расстояние, трюки, предметы и зона приземления увеличивают выигрыш. Есть случайные множители и бонусы.\n\nКак играть:\nВо время падения:\nКепка Mega: +0,2x/шт.\nМонета: +2,0x\nСальто: +0,1x/шт.\nДистанция: +1x/м\n\nГрозовые тучи: выигрыш ÷ 2\n\nДвигатель / орёл: проигрыш.\n\nK-Hole (чёрная дыра):\nЕсли босс падает в чёрную дыру, Rocket Man отправляется к «Марсу»; случайный 1x–11x умножает текущий выигрыш.\n\nЗоны бонусов:\nTruck Award: × 5\nSecond Best Friend Award: Возводит ваш коэффициент выплаты в квадрат (ставка остаётся прежней, пример: 2 $ × 5x → 2 $ × 25x = 50 $)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Добавляет фиксированные 5000x к вашему выигрышу (не умножается). Чтобы получить White House Award, необходимо приземлиться внутри здания. Секретный вход находится под флагом.\n\nТеоретический RTP: 96 %.\n\nОкругления нормальны; непредсказуемая физика RTP не меняет.\n\nИграйте ответственно.\n\nПри обрыве связи ставки рассчитываются, выигрыши выплачены.\n\nВерсия v1.0.0 – 25.05.2025.",tr:"OYUN KURALLARI\n\nGenel Bakış:\nDrop the Boss fizik tabanlı bir şans oyunudur. Amaç, Patronun ivmesinin sıfıra ulaşmasını engellemektir. Mesafe, akrobasi, toplanan öğeler ve iniş bölgesi ödülü artırır. Rastgele çarpanlar ve bonuslar mevcuttur.\n\nNasıl Oynanır:\nBoss düşerken:\nMega şapkası: +0,2x/adet\nJeton: +2,0x\nTakla: +0,1x/adet\nMesafe: +1x/m\n\nFırtına bulutu: kazanç ÷ 2\n\nMotor / kartal: kayıp.\n\nK-Hole (kara delik):\nBoss kara deliğe düşerse Rocket Man \"Mars\"a fırlatılır ve rastgele 1x-11x çarpanı toplam kazancı artırır.\n\nBonus Bölgeleri:\nTruck Award: × 5\nSecond Best Friend Award: Ödeme çarpanınızı karesiyle çarpar (bahsiniz değişmez, örn. $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Kazancınıza sabit 5000x ekler (çarpılmaz). White House Award'ı kazanmak için binanın içine iniş yapmalısınız. Gizli giriş bayrağın altındadır.\n\nTeorik RTP: 96 %.\n\nYuvarlama farkları normaldir; fizik hatası RTP'yi etkilemez.\n\nSorumlu oynayın.\n\nBağlantı koparsa bahisler sonuçlandırılır, kazanç ödenir.\n\nSürüm v1.0.0 – 25.05.2025.",vi:"LUẬT CHƠI\n\nTổng quan:\nDrop the Boss là trò chơi may rủi dựa trên vật lý. Mục tiêu là giữ cho đà của Boss không về 0. Quãng đường, pha biểu diễn, vật phẩm và khu hạ cánh tăng thưởng. Có hệ số nhân và bonus ngẫu nhiên.\n\nCách chơi:\nKhi Boss rơi:\nMũ Mega: +0,2x/chiếc\nXu: +2,0x\nNhào lộn: +0,1x/lần\nKhoảng cách: +1x/m\n\nMây giông: thưởng ÷ 2\n\nĐộng cơ / đại bàng: thua.\n\nK-Hole (hố đen):\nNếu Boss rơi vào hố đen, Rocket Man được phóng tới “Sao Hỏa” và hệ số ngẫu nhiên 1x–11x sẽ nhân tổng thưởng.\n\nKhu bonus:\nTruck Award: × 5\nSecond Best Friend Award: Bình phương hệ số nhân trả thưởng (tiền cược không đổi, ví dụ: $2 × 5x → $2 × 25x = $50)\nChump Towers Award: × 50\nGolden Tee Award: × 100\nWhite House Award: Thêm 5000x cố định vào thắng cược của bạn (không nhân). Để giành White House Award, bạn phải đáp xuống bên trong tòa nhà. Lối vào bí mật nằm dưới lá cờ.\n\nRTP lý thuyết: 96 %.\n\nSai số làm tròn bình thường; vật lý bất thường không ảnh hưởng RTP.\n\nChơi có trách nhiệm.\n\nMất kết nối: cược được xử lý, tiền thắng đã trả.\n\nPhiên bản v1.0.0 – 25.05.2025.",zh:"游戏规则\n\n概述：\n《Drop the Boss》是一款物理驱动的赌博游戏。目标是防止 Boss 的动量降为 0。距离、特技、收集物品与着陆区域都会提高奖金，并包含随机倍增器与奖励。\n\n玩法：\nBoss 下落时：\nMega 帽：+0.2x/顶\n金币：+2.0x\n空翻：+0.1x/次\n距离：+1x/米\n\n暴风云：奖金 ÷ 2\n\n发动机 / 巨鹰：直接失败。\n\nK-Hole（黑洞）：\n若 Boss 掉入黑洞，Rocket Man 会被发射至“火星”，随机 1x–11x 倍率乘以当前奖金。\n\n奖励区：\nTruck 奖励：× 5\nSecond Best Friend Award：将派彩金倍率平方（下注金额保持不变，例如：$2 × 5x → $2 × 25x = $50）\nChump Towers 奖励：× 50\nGolden Tee 奖励：× 100\nWhite House 奖励：在您的奖金上额外增加固定 5000x（不参与倍率计算）。要赢得 White House 奖励，您必须落在建筑物内部。秘密入口在旗帜下方。\n\n理论 RTP：96 %。\n\n四舍五入误差正常；异常物理不影响 RTP。\n\n理性博彩。\n\n断线时结算投注并已派奖。\n\n版本 v1.0.0 – 2025-05-25."},n.socialText="GAME RULES\n\nGame Overview:\nDrop the Boss is a physics-driven game of chance. The aim of the game is to keep the Boss's momentum from reaching 0. With each spin, Boss accumulates prizes based on distance, stunts, collected items, and the final landing zone. The game includes random multipliers, bonus triggers, and high-reward feature endings.\n\nHow to Play:\nDuring Boss’s descent, various actions contribute to your total win:\nCollect Mega Hats: +0.2x multiplier per hat\nHit Coin: +2.0x multiplier\nComplete a Front Flip or Backflip: +0.1x multiplier per flip\nTravel Distance: +1x multiplier per in-game metre travelled\n\nHit Storm Clouds: Divides your current accumulated win by 2 (rounded down)\n\nEngine Disaster / Eagle: It is possible for Boss to be sucked into the plane engine, or for a giant eagle to swoop down and take him away. These are losses and result in no win.\n\nK-Hole Feature (triggered by Black Hole):\nIf Boss falls into a black hole during the game, the K-Hole Feature is triggered.\nRocket Man is launched toward “Mars”. A random multiplier between 1x and 11x is awarded. This prize multiplies your current total accumulated winnings.\n\nFeature Landing Zones:\nAt the bottom landing zone, there are several obstacles Boss is aiming for. If Boss collides with one of these obstacles, a bonus award is activated. They are as follows:\nTruck Award: Multiplies total win by 5x\nSecond Best Friend Award: Squares your win multiplier (your spin amount stays the same, e.g. $2 × 5x → $2 × 25x = $50)\nChump Towers Award: Multiplies total win by 50x\nGolden Tee Award: Multiplies total win by 100x\nWhite House Award: Adds a flat 5000x to your win (not multiplied). To win the White House Award, you must land inside the building. The secret entrance is under the flag.\n\nReturn to Player:\nThis game has a theoretical RTP of 96 %.\n\nNote: Calculations done in the physics/maths engine use floating-point numbers. These numbers are rounded to two decimal places when displayed to the player. Therefore, when numbers are multiplied there may be minor rounding differences, which increase with larger figures. This is not an error; the RTP is calculated from the floating-point numbers.\n\nNote: This game uses a physics engine, and such engines may behave chaotically on occasion. Unpredictable behaviour may result in Boss stopping unexpectedly, or collisions not being detected, resulting in completion of a spin. If you experience unusual physics behaviour, any wins will still be processed correctly based on the final game state.\n\nResponsible Play:\nDrop the Boss is a game of chance. Please play responsibly. Players should play only amounts they can afford to lose.\n\nConnectivity Protocol:\nIn the event of a disconnection, all spins in motion at the time will be settled. Upon reconnection these spins will not be displayed, but any wins will already have been processed.\n\nGame version v1.0.0 – last updated 6 August 2025.",n.camera=void 0,n}a(n,e);var o=n.prototype;return o.onLoad=function(){var e;this.camera=l.getScene().getChildByName("Canvas").getChildByName("Camera"),this.eventSystem=d.resolve("IEventSystem");var n=d.resolve("lang");null!=(e=d.resolve("RgsConfig"))&&null!=(e=e.jurisdiction)&&e.socialCasino&&"en"==n?this.rulesText.string=this.socialText:this.setGameRulesText(n),this.buttonPressed=this.buttonPressed.bind(this),this.eventSystem.RegisterListener(new c,this.buttonPressed,this),this.node.active=!1,this.menuButtonClicked=this.menuButtonClicked.bind(this),this.eventSystem.RegisterListener(new h,this.menuButtonClicked,this)},o.setGameRulesText=function(e){this.rulesText&&this.rulesMap[e]?this.rulesText.string=this.rulesMap[e]:(console.warn("Language "+e+" not supported. Defaulting to English."),this.rulesText.string=this.rulesMap.en)},o.buttonPressed=function(){this.node.active=!this.node.active},o.menuButtonClicked=function(){this.node.active=!1},o.update=function(e){this.node.setPosition(this.camera.position.x,this.camera.position.y)},n}(u)).prototype,"rulesText",[p],{configurable:!0,enumerable:!0,writable:!0,initializer:function(){return null}}),g=w))||g));o._RF.pop()}}}));

